import { EquipoComponent } from './equipo/equipo.component';
import { TopScoreComponent } from './top-score/top-score.component';

@NgModule({
  declarations: [
    AppComponent,
    MarcadorComponent,
    EquipoComponent,
    TopScoreComponent
